namespace Shine
{
	/** 单位特殊移动类型(generated by shine) */
	export class UnitSpecialMoveType
	{
		/** 传送 */
		public static Transport:number=1;
		
		/** 固定距离时间击退(AttackAction的TargetSpecialMove用)(arg0:距离,arg1:时间ms) */
		public static HitBack:number=2;
		
		/** 闪现(向技能释放点) */
		public static Blink:number=1;
		
		/** 长度 */
		public static size:number=3;
		
	}
}
